import React, { Component } from "react";
import axios from "axios";

class FamilyMembers extends Component {
  state = {};

  componentDidMount() {
    axios.get("/api/getfamilymembers");
  }

  render() {
    return <div>Members</div>;
  }
}

export default FamilyMembers;
